1.0.0.description:
Extension allow customer to place an order in one single click based on&#xD;
custom phone number.&#xD;
Email field can be enabled or disabled.&#xD;
Order can have current product plus cart content or only current product.

1.0.1.description:
Extension allow customer to place a fast order in one single click based on&#xD;
customer provided phone number and/or email.&#xD;
Additional notes can be added to fast order by customer;&#xD;
Customer can enable checkbox to make order only with current product &#xD;
or cart content and current product.

